// SPDX-License-Identifier: MIT
pragma solidity >=0.6.12 <0.9.0;

import "@openzeppelin/contracts/access/Ownable.sol";

contract Organization is Ownable {
    address payable ownerAddress;
    uint totalAmount = 0; 
        
    event Received(address indexed sender, uint256 amount);

    enum ContractState {
        Created,
        Sealed,
        Canceled,
        Executed
    }
    enum ContractType {
        Consensus,
        Majority
    }

    struct Contract {
        string name;
        string terms;
        ContractState contractState;
        ContractType contractType;
        uint32 numberOfParticipants;
        uint32 forVotes;
        uint32 againstVotes;
        uint256 amount;
        address payableUserAddress;
        address payeeAddress;
        bool hasPaidToContractAdmin;
    }

    mapping(uint256 => Contract) ContractMgt;
    mapping(string => uint256[]) OrgContracts;
    mapping(address => uint256[]) ContractingParties;

    constructor(address _ownerAddress) Ownable(_ownerAddress) {
        ownerAddress = payable(msg.sender);
    }

    function getTotalAmount() external view onlyOwner returns (uint){
        return totalAmount;
    }

    receive() external payable {
        totalAmount += msg.value;
        emit Received(msg.sender, msg.value);
    }

    function payToContractAdmin(address _payeeAddress, uint256 _contractId) external {
        Contract memory currentContract  = ContractMgt[_contractId];
        (bool success,) =  _payeeAddress.call{value: currentContract.amount}(
            abi.encodeWithSignature("updateContractStatus(uint256)", _contractId)
        );
        require(success, "Payment is not completed"); 
    }

    function updateContractStatus(uint256 _contractId) external payable returns (bool){ 
        ContractMgt[_contractId].hasPaidToContractAdmin = true;
        return true;
    }

}

